import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'backOffice';
}
<app-navbar></app-navbar>
<router-outlet></router-outlet>
<div class="navbar-dark text-center" style="">
    <button type="button" class="btn btn-primary" routerLink="/grupo">Grupos</button>
    <button type="button" class="btn btn-primary" routerLink="/user">Usuarios</button>
    <button type="button" class="btn btn-primary" routerLink="/ticket">Tickets</button>
    <button type="button" class="btn btn-primary" routerLink="/producto">Productos</button>
  </div>
